function [ D ] = MatD( n, x,y )
    D=zeros(n,n);
    for i=1:n-1
        for j=i+1:n
            D(i,j)=round(sqrt((x(i)-x(j))^2+(y(i)-y(j))^2));
            D(j,i)=D(i,j);
        end
    end
end

function L=TourLength(tour,model)

    n=numel(tour);

    tour=[tour tour(1)];
    
    L=0;
    for i=1:n
        L=L+model.D(tour(i),tour(i+1));
    end

end